import React from 'react';

const DebugInfo = ({ 
  refreshCount, 
  lastRefresh, 
  totalCandidates, 
  loading, 
  error,
  imagesPreloaded 
}) => {
  const formatTime = (isoString) => {
    if (!isoString) return 'Never';
    const date = new Date(isoString);
    return date.toLocaleTimeString();
  };

  const getStatusColor = (status) => {
    switch (status) {
      case 'success': return '#28a745';
      case 'error': return '#dc3545';
      case 'warning': return '#ffc107';
      case 'loading': return '#007bff';
      default: return '#6c757d';
    }
  };

  const getImageStatus = () => {
    if (imagesPreloaded) {
      return { text: '‚úÖ Images Preloaded', color: 'success' };
    } else if (loading) {
      return { text: 'üîÑ Loading Images...', color: 'loading' };
    } else {
      return { text: '‚ö†Ô∏è Images Not Preloaded', color: 'warning' };
    }
  };

  return (
    <div className="debug-info">
      <h3>üîß System Status</h3>

      <div className="status-grid">
        <div className="status-item">
          <span className="status-label">Data Refresh Count:</span>
          <span className="status-value">{refreshCount}</span>
        </div>

        <div className="status-item">
          <span className="status-label">Last Data Refresh:</span>
          <span className="status-value">{formatTime(lastRefresh)}</span>
        </div>

        <div className="status-item">
          <span className="status-label">Total Candidates:</span>
          <span className="status-value">{totalCandidates}</span>
        </div>

        <div className="status-item">
          <span className="status-label">Data Loading:</span>
          <span 
            className="status-value"
            style={{ color: getStatusColor(loading ? 'loading' : 'success') }}
          >
            {loading ? 'üîÑ Loading...' : '‚úÖ Loaded'}
          </span>
        </div>

        <div className="status-item">
          <span className="status-label">Image System:</span>
          <span 
            className="status-value"
            style={{ color: getStatusColor(getImageStatus().color) }}
          >
            {getImageStatus().text}
          </span>
        </div>

        {error && (
          <div className="status-item error">
            <span className="status-label">Error:</span>
            <span className="status-value" style={{ color: getStatusColor('error') }}>
              {error}
            </span>
          </div>
        )}
      </div>

      <div className="mobile-optimization-info">
        <h4>üì± Mobile Optimization</h4>
        <ul>
          <li>‚úÖ Image preloading for faster loading</li>
          <li>‚úÖ Server connection warm-up</li>
          <li>‚úÖ Progressive image loading</li>
          <li>‚úÖ Fallback to initials if images fail</li>
          <li>‚úÖ Responsive design for all screen sizes</li>
        </ul>
      </div>

      <div className="troubleshooting-tips">
        <h4>üîß Troubleshooting Tips</h4>
        <ul>
          <li>If images don't load, try refreshing the page</li>
          <li>Check your internet connection</li>
          <li>Try switching between WiFi and mobile data</li>
          <li>Clear browser cache if issues persist</li>
        </ul>
      </div>
    </div>
  );
};

export default DebugInfo;
